from flask import Flask, request
app = Flask(__name__)

@app.route('/make_my_wish')
def make_wish():
    wish = request.args.get('wish')

    message = "<p>Your wish: {} has been granted!</p>".format(wish)

    return message

if __name__ == '__main__':
    app.run()

