def application(environ, start_response):
    path = environ['PATH_INFO']

    if path == '/code':
        handler = load_module('my_code')
        output = handler.handle_request(environ)
    elif path == '/blog':
        handler = load_module('my_blog')
        output = handler.handle_request(environ)
    elif path == '/todo':
        handler = load_module('my_todo')
        output = handler.handle_request(environ)
    else:
        output = '<h1>Not found</h1>'

    start_response('200 OK', [('Content-type', 'text/html')])
    return output

