from flask import Flask, request

app = Flask(__name__)

notes = []

@app.route("/post", methods=["POST"])
def post():
    title = request.form.get('title')
    content = request.form.get('content')

    note = {
        'title': title,
        'content': content
    }

    notes.append(note)

    return "Note posted!"

@app.route("/get")
def get():
    return render_template('notes.html', notes=notes)
